&lt;p&gt;Sentences of a paragraph are given below in jumbled order. Arrange the sentences in the correct order to form a meaningful and coherent paragraph.&lt;/p&gt;

&lt;p&gt;A. In 1944, he was honoured by King George VI with a Knighthood and became Sir Alexander Fleming.&lt;/p&gt;

&lt;p&gt;B. On receiving this great honour, Fleming said in his usual modest way, &amp;ldquo;Wherever I&amp;nbsp;go, people thank me for saving their lives. I&amp;nbsp;didn&amp;rsquo;t do anything; I&amp;nbsp;Just found a remedy that was there.&amp;rdquo;&lt;/p&gt;

&lt;p&gt;C. Fleming became famous overnight and was regarded as one of the most distinguished scientists of his time.&lt;/p&gt;

&lt;p&gt;D. The next year, he and his fellow bacteriologists, whose combined efforts had led to the great discovery, were honoured with a joint Nobel Prize.&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Sentences of a paragraph are given below in jumbled order. Arrange the sentences in the correct order to form a meaningful and coherent paragraph.&lt;/p&gt;

&lt;p&gt;A. It was the night before the day fixed for his coronation, and the young King was sitting alone in his beautiful chamber.&lt;/p&gt;

&lt;p&gt;B. And, indeed, it was the hunters who had found him, coming upon him almost by chance as, bare-limbed and pipe in hand, he was following the flock of the poor goat herd who had brought him up, and whose son he had always fancied himself to be.&lt;/p&gt;

&lt;p&gt;C. The lad - for he was only a lad, being but sixteen years of age - was not sorry at their departure, and had flung himself back with a deep sigh of relief on the soft cushions of his embroidered couch, lying there, wild-eyed and open-mouthed, like a brown woodland Faun, or some young animal of the forest newly snared by the hunters.&lt;/p&gt;

&lt;p&gt;D. His courtiers had all taken their leave of him, bowing their heads to the ground, according to the ceremonious usage of the day, and had retired to the Great Hall of the Palace, to receive a few last lessons from the Professor of Etiquette; there being some of them who had still quite natural manners, which in a courtier is, I need hardly say, a very grave offence.&lt;/p&gt;
